import React from 'react';
import Navbar from './components/Navbar';
import Home from './components/pages/Home';
import AboutSection from './components/AboutSection';
import HeroSection from './components/HeroSection';

function App() {
  return (
    <>
      <Navbar />
      <HeroSection />
      <AboutSection />
      <Home />
    </>
  );
}

export default App;
